import React from 'react'

function TotoItems(props){
  const todoItem = props.todoItem
  return (
      <div>
        <input
          id={"todoItem_" + todoItem.id}
          type="checkbox"
          defaultChecked = {todoItem.isCompleted ? 'checked' : ''}
          onChange = {props.handleOnChange('message')}
        />
        <label htmlFor={"todoItem_" + todoItem.id}>{todoItem.todo}</label>
      </div>
  )
}

export default TotoItems
